import React from "react";

class Product extends React.Component {
  constructor(props) {
    super(props)

  }
  item = this.props.product
  render() {
    return (
      <a className="card" href="">
        <h2 className="cardHeader">{this.item.product}</h2>
        <p className="brand">Производитель: {(this.item.brand) ? this.item.brand : "Не указано"}</p>
        <p className="price">Цена: {(this.item.price >= 1000) ? `${Math.round(this.item.price/1000)} ${(this.item.price % 1000 == 0) ? `000` : (this.item.price % 1000 < 100) ? `0${this.item.price % 1000}` : `00${this.item.price % 1000}`}`  : this.item.price} p.</p>
        <p className="id">id: {this.item.id}</p>
      </a>
    )
  }
}

export default Product
